import React from 'react';

import './footer.css';

const Footer = () => {
    return (
        <footer className="footer ">
            <p>
                ООО «Управляющая компания «Фотошкола»<br/>
                ИНН 1659163880 | ОГРН 1151690090970<br/>
                <a href="#">Политика конфиденциальности</a>
            </p>
        </footer>
    );
};

export default Footer;
